- input: "TEXT\x1CC00451153\x1C.TEXT\x1C\x1CF3XA\x1CThe first amended filing of Schedule
    B erroneously attributed nine contributions to the primary election.  Those contributions
    were to Bobby Scott for Congress, Bob Goodlatte for Congress Committee, Cantor
    for Congress, Citizens for Altmire, Friends of John Boehner, Heath Shuler for
    Congress, Jim Jordan for Congress, Schiff for Congress and Zach Space for Congress
    Committee.    Neither the contribution checks nor any accompanying communication
    from Gridiron PAC designated those contributions to any particular election.  Because
    those contributions were made after the primary election date, they should have
    been attributed to the general election.  In addition, this amended Schedule B
    inserts data regarding the office sought, state and congressional district for
    all contributions made.\n"
